// src/pages/TrainSearch.js
import React, { useState } from 'react';
import axios from 'axios';

const TrainSearch = () => {
  const [departureStation, setDepartureStation] = useState('');
  const [arrivalStation, setArrivalStation] = useState('');
  const [departureDate, setDepartureDate] = useState('');
  const [results, setResults] = useState([]);

  const handleSearch = async () => {
    try {
      const response = await axios.get('http://localhost:5000/api/trains/search', {
        params: {
          departureStation,
          arrivalStation,
          departureDate
        }
      });
      setResults(response.data.trains);
    } catch (error) {
      console.error('Error fetching train data', error);
    }
  };

  return (
    <div>
      <h1>Search Trains</h1>
      <input
        type="text"
        placeholder="Departure Station"
        value={departureStation}
        onChange={(e) => setDepartureStation(e.target.value)}
      />
      <input
        type="text"
        placeholder="Arrival Station"
        value={arrivalStation}
        onChange={(e) => setArrivalStation(e.target.value)}
      />
      <input
        type="date"
        value={departureDate}
        onChange={(e) => setDepartureDate(e.target.value)}
      />
      <button onClick={handleSearch}>Search</button>

      {results.length > 0 && results.map((train, index) => (
        <div key={index}>
          <p>Train ID: {train.TrainID}</p>
          <p>Departure Time: {train.DepartureDateTime}</p>
          <p>Arrival Time: {train.ArrivalDateTime}</p>
        </div>
      ))}
    </div>
  );
};

export default TrainSearch;
